import React from 'react'
import '../Styles/Table-Styles.css'
import {Dropdown} from 'react-bootstrap';


export class Table extends React.Component {

    async renderTableHeader () {
       let header = await Object.keys(this.props.instances[0])
       return header.map((key, index) => {
          return <th key={index}>{key.toUpperCase()}</th>
       })
    }
    selectRegion (key) {
        console.log(key);
    }
    render() {
        const region = [{1: 'ap-south-1'},
            {2: 'eu-west-1'},
            {3: 'ap-southeast-1'},
            {4: 'ap-southeast-2'},
            {5: 'eu-central-1'},
            {6: 'ap-northeast-2'},
            {7: 'ap-northeast-1'},
            {8: 'us-east-1'},
            {9: 'sa-east-1'},
            {10: 'us-west-1'},
            {11: 'us-west-2'}
        ];
       return (
          <div className="table-container">
              <Dropdown>
                <Dropdown.Toggle variant="success" id="dropdown-basic">
                    Region
                </Dropdown.Toggle>
                <Dropdown.Menu>
                    {region.map(item => {
                        return  <Dropdown.Item eventKey={Object.keys(item)[0]} onSelect={eventKey => this.selectRegion(eventKey)}>Action</Dropdown.Item>
                    })}
                </Dropdown.Menu>
                </Dropdown>
             <h1 id='title'>AWS EC2 Instances</h1>
             <table id='instances'>
                <tbody>
                   <tr>
                       <th>Instance ID</th>
                       <th>Image ID</th>
                       <th>Instance Type</th>
                       <th>Availabilty Status</th>
                       <th>Status</th>
                   </tr>
                   {this.props.instances.map((instance, index) => {
                        return (
                            <tr key={instance.InstanceID}>
                                <td>{instance.InstanceID}</td>
                                <td>{instance.ImageID}</td>
                                <td>{instance.InstanceType}</td>
                                <td>{instance.AvailabilityZone}</td>
                                <td>{instance.State}</td>
                            </tr>
                        );
                })}
                </tbody>
             </table>
          </div>
       )
    }
 }
